import React from "react";

function DeckListItem({ id, name, description }) {
    return (
        <div className="card mb-2">
            <div className="card-body">
                <h2>{name}</h2>
                <p>{description}</p>
                <a href={`/decks/${id}`} className="btn btn-secondary mr-1">View</a>
                <a href={`/decks/${id}/study`} className="btn btn-primary">Study</a>
            </div>
        </div>
    );
}

export default DeckListItem;
